import './App.css';
import logo from './wre-logo.png';

function App() {
  return (
    <div>
      <img src={ logo } alt="logo" />
    </div>
  );
}

function YourMom() {
  return (
    <div>
      <img src={ logo } alt="logo" />
    </div>
  );
}

export default { App, YourMom };
